(7, 77, NULL, 1, NULL, '<div class="dd-text"><div class="cols3-dd">Покупка квартиры может стать непреходящей головной болью или простым решением, которое не отнимет много времени. Используя в качестве путеводителя базу данных, можно в короткий срок и без нечеловеческих усилий выбрать квартиру свой мечты.\nКак правило, существует два решения такой проблемы, как покупка квартиры в Москве. Первый, «дедовский» способ – объявления, которые начинаются неизменным словом «Куплю». Такой путь требует много времени и не меньше финансовых вложений. К тому же, таким образом, вы информируете каждого о том, что у вас есть определенная сумма денег! А в наше время, сведения подобного рода могут заинтересовать различных мошенников, которые помогут вам благополучно расстаться с накопленными сбережениями. Второй способ – в судорожном темпе бегать по риэлтерским конторам в поисках подходящего варианта. </div><div class="cols3-dd">Опять-таки, поиск своей мечты отнимет столько душевных сил, что вы, в итоге, передумаете покупать квартиру. А мы предлагаем вам использовать тщательно организованную базу данных, не выходя из дома, чтобы подобрать оптимальный вариант. Периодическое обновление баз данных поможет быть в курсе всех предложений и сделать правильный выбор. Чтобы сэкономить ваше время, мы создали несколько фильтров, которые помогут быстро подобрать желаемое жилье. Поиск ведется по заданным параметрам, учитываются важные аспекты покупки: стоимость, месторасположение, этаж и общая площадь жилья. Детальный подход к каждому объекту поможет решить такую сложную задачу, как покупка квартиры в Москве. Москва живет по тем же законам недвижимости, что и весь остальной мир, поэтому цена за квадрат жилплощади складывается</div><div class="cols3-dd cols3-dd-last">из множества взаимозависимых факторов. В первую очередь, конечно же, в расчет берется округ, в котором расположена квартира. К примеру, однокомнатные квартиры в Центральном округе будут в несколько раз дороже, чем их собратья в Южном округе. Так же на стоимость квартир влияет тип дома, возраст постройки и окружающая инфраструктура. На сегодняшний день 5 тысяч долларов – средняя цена за метр и потому Москва, к сожалению, все еще остается одним из самых дорогих городов России.\nПокупка квартиры в Москве, да и вообще в любом другом городе, это серьезное и значительное решение. Поэтому важно рассмотреть все возможные варианты, чтобы выбрать ту квартиру, о покупке которой впоследствии не придется жалеть.</div></div>\n'),
(8, 77, NULL, 2, NULL, '<div class="dd-text"><div class="cols3-dd">Гости столицы часто сталкиваются с необходимостью подыскать комфортное и недорогое жильё на пару дней или на несколько недель. Проблема тут не только в том, что в хороших гостиницах редко можно найти свободные номера, а и в плохом соотношении «цена/качество», которые не соответствуют общепринятым нормам. Проживание в гостинице очень часто связано с целым рядом сложностей и отрицательных моментов. Это и необходимость предоставлять все свои паспортные данные</div><div class="cols3-dd"> сотрудникам гостиницы, и невозможность приглашать в гости знакомых после 23 вечера, и определённая казенность обстановки в которой приходится находиться сутки и более. На сегодняшний день существует достойная альтернатива проживанию в гостинице – аренда без посредников Москва. Выбрав этот вариант, вы получаете комфортное домашнее жильё по приемлемым ценам. Вас никто не будет беспокоить, вы сможете хоть до утра принимать гостей, приготовить для себя привычную еду и пить </div><div class="cols3-dd cols3-dd-last"> кофе в постели. Снять без посредников в Москве квартиру – это оптимальный вариант решения проживания в столице на короткий и на длительный срок. Аренда без посредников (Москва в данном случае идеальный пример) подразумевает, что вы получаете прямые телефоны хозяев и самостоятельно договариваетесь о сроке пребывания и цене проживания. При этом снять без посредников в Москве вы можете не только однокомнатную квартиру, но и многоуровневые апартаменты.</div></div>'),
(9, 77, NULL, 5, NULL, 'Практически ни одно предприятие не обходится без того, чтобы арендовать или приобрести в собственность офисные, торговые или же складские помещения. Все они в совокупности и представляют собой рынок так называемой коммерческой недвижимости. Соответственно, его основными сегментами являются офисы, торговые помещения и склады. Рассмотрим основные характеристики и особенности этого рынка, а также тенденции его развития применительно к Москве.\n\nЛюбое столичное предприятие для осуществления своей деятельности, так или иначе, должно арендовать или же купить офис в Москве или ее окрестностях. Казалось бы, подобрать подходящий вариант не составляет особого труда: достаточно воспользоваться Интернетом, набрать в любом поисковике, к примеру, «офисные помещения Москва», и дело, как говорится, наполовину сделано. Конечно, количество результатов, которые будут получены, впечатляет, однако это, к сожалению, еще не повод для оптимизма. Вся проблема в том, что деловая активность в столице гораздо выше, чем во многих других городах нашей страны, а вот на офисные помещения Москва, увы, отнюдь не богата: спрос на них существенно превышает предложение. Причем во время кризиса ситуация вроде бы стала исправляться, цены серьезно снизились и купить офис в Москве стало для многих более реально, чем ранее. Однако в связи с тем, что строительство многих деловых центров было заморожено, спрос снова стал выше предложения, и рынок снова разбалансировался. Для такого дела, как продажа офиса Москва, с одной стороны – очень «выгодный» город, поскольку уровень цен высок, а с другой – убыточный, поскольку в связи с тем же кризисом количество покупателей, которые могут позволить себе приобрести в собственность офисное помещение по таким ценам, тоже резко упало. Более того, многие клиенты девелоперов сворачивают или резко сокращают свою деятельность, и уже сами вынуждены подавать объявления в рубрики «продажа офиса Москва».\n\nСитуация с торговыми площадями в столице нашей Родины тоже сложная и далеко неоднозначная. Продажа магазина в Москве его собственником происходит, как показывает практика, только в тех случаях, если он находится на грани разорения (что случается, к счастью, не так уж и часто), или если он выводит свои активы в другой бизнес (также не самое распространенное явление). Так что для того, чтобы купить магазин Москва представляет собой не самый простой рынок. Продажа магазина в Москве осуществляется, как правило, по довольно высоким ценам, поэтому многие предприниматели, поискав варианты во Всемирной Паутине по запросу «продажа магазина Москва» зачастую отказываются от этой идеи и подыскивают варианты за пределами МКАД. Там сейчас активно возводятся различные крупные торговые комплексы, хотя в последние пару лет судьба некоторых из них остается под вопросом по причине недостаточного финансирования для того, чтобы завершить строительство. Так что теперь для того, чтобы купить магазин Москва и область с точки зрения количества доступных как по цене, так и по качеству предложений стремительно приближаются друг к другу. Получается, для такого занятия, как продажа магазина Москва, несмотря на высокие цены на недвижимость, не является самым благоприятным местом, а область отстает от спроса, поскольку кризис отрицательно сказался на возведении новых торговых объектов.\n\nОчень похожая ситуация складывается и на рынке складской недвижимости, поскольку он очень зависим как от темпов роста производственных, так и торговых предприятий. Сейчас экономика находится в фазе стагнации, и по этой причине оживления спроса на качественные складские помещения не наблюдается, и в ближайшем будущем, очевидно, не предвидится.'),
(10, 77, NULL, 6, NULL, '<div class="dd-text"><div class="cols3-dd">Практически ни одно предприятие не обходится без того, чтобы арендовать или приобрести в собственность офисные, торговые или же складские помещения. Все они в совокупности и представляют собой рынок так называемой коммерческой недвижимости. Соответственно, его основными сегментами являются офисы, торговые помещения и склады. Рассмотрим основные характеристики и особенности этого рынка, а также тенденции его развития применительно к Москве. Любое столичное предприятие для осуществления своей деятельности, так или иначе, должно арендовать или же купить офис в Москве или ее окрестностях. Казалось бы, подобрать подходящий вариант не составляет особого труда: достаточно воспользоваться Интернетом, набрать в любом поисковике, к примеру, «офисные помещения Москва», и дело, как говорится, наполовину сделано. Конечно, количество результатов, которые будут получены, впечатляет, однако это, к сожалению, еще не повод для оптимизма. Вся проблема в том, что деловая активность в столице гораздо выше, чем во многих других городах нашей страны, а вот на офисные помещения Москва, увы, отнюдь не богата: спрос на них существенно превышает предложение. Причем во время кризиса ситуация вроде</div><div class="cols3-dd">бы стала исправляться, цены серьезно снизились и купить офис в Москве стало для многих более реально, чем ранее. Однако в связи с тем, что строительство многих деловых центров было заморожено, спрос снова стал выше предложения, и рынок снова разбалансировался. Для такого дела, как продажа офиса Москва, с одной стороны – очень «выгодный» город, поскольку уровень цен высок, а с другой – убыточный, поскольку в связи с тем же кризисом количество покупателей, которые могут позволить себе приобрести в собственность офисное помещение по таким ценам, тоже резко упало. Более того, многие клиенты девелоперов сворачивают или резко сокращают свою деятельность, и уже сами вынуждены подавать объявления в рубрики «продажа офиса Москва». Ситуация с торговыми площадями в столице нашей Родины тоже сложная и далеко неоднозначная. Продажа магазина в Москве его собственником происходит, как показывает практика, только в тех случаях, если он находится на грани разорения (что случается, к счастью, не так уж и часто), или если он выводит свои активы в другой бизнес (также не самое распространенное явление). Так что для того, чтобы купить магазин Москва представляет собой не самый простой рынок. Продажа магазина в Москве осуществляется, как правило,</div><div class="cols3-dd cols3-dd-last">по довольно высоким ценам, поэтому многие предприниматели, поискав варианты во Всемирной Паутине по запросу «продажа магазина Москва» зачастую отказываются от этой идеи и подыскивают варианты за пределами МКАД. Там сейчас активно возводятся различные крупные торговые комплексы, хотя в последние пару лет судьба некоторых из них остается под вопросом по причине недостаточного финансирования для того, чтобы завершить строительство. Так что теперь для того, чтобы купить магазин Москва и область с точки зрения количества доступных как по цене, так и по качеству предложений стремительно приближаются друг к другу. Получается, для такого занятия, как продажа магазина Москва, несмотря на высокие цены на недвижимость, не является самым благоприятным местом, а область отстает от спроса, поскольку кризис отрицательно сказался на возведении новых торговых объектов. Очень похожая ситуация складывается и на рынке складской недвижимости, поскольку он очень зависим как от темпов роста производственных, так и торговых предприятий. Сейчас экономика находится в фазе стагнации, и по этой причине оживления спроса на качественные складские помещения не наблюдается, и в ближайшем будущем, очевидно, не предвидится.</div></div>'),
(581404, 77, 164831, 6, 'Офис', ' Если вас интересует аренда офиса CВАО, вы попали на нужную страницу. Здесь вы найдете множество вариантов предложений собственников объектов – от небольших офисов до просторных офисных помещений для крупных компаний. На сегодняшний день, аренда офиса в CВАО – это выгодно и престижно. Кроме того, удобное расположение офисов – несомненный плюс для любого бизнеса.'),
(581410, 77, 164757, 6, 'Офис', 'Вас интересует аренда офисов в ВАО? На нашем сайте вы найдете множество предложений по аренде коммерческой недвижимости в Москве. Вашему вниманию представлены мелкие, средние и крупные бизнес-центры всех классов, а также складские и другие помещения. Вы сможете быстро сравнить цены, другие условия, оснащенность зданий и аренда офиса в ВАО займет у вас минимум времени! '),
(581413, 77, 164817, 6, 'Офис', ' Для серьезных деловых людей на нашем сайте всегда имеются в наличии такие предложения, как аренда офиса ЗАО. Западный административный округ является одним из самых престижных, живописных и экологически чистых районов Москвы с хорошо развитым транспортным сообщением. Безусловно, аренда офиса ЗАО – хороший деловой выбор для любого предпринимателя.'),
(581424, 77, 164742, 6, 'Офис', 'Аренда офиса в САО будет особенно интересна тем компаниям, которые часто принимают делегации, гостей из других городов, из-за границы, поскольку аэропорт Шереметьево находится непосредственно на территории САО. Аренда офиса в САО – это возможность получить отличный офис по сходной цене в районе с развитой инфраструктурой, и в непосредственной близости от центра. '),
(581426, 77, 164848, 6, 'Офис', ' Аренда офиса СЗАО не будет для вас проблемой, если вы обратитесь к нам. На нашем сайте вы найдете всю необходимую информацию, касающуюся аренды коммерческой недвижимости и жилых помещений в Москве. База данных на нашем веб ресурсе постоянно обновляется, так что аренда офиса в СЗАО будет очень оперативной. Более подробную информацию можете узнать у наших менеджеров.'),
(581431, 77, 164862, 6, 'Офис', 'Безусловно, аренда офиса ЦАО Москвы – мечта многих арендаторов. Центральный административный округ Москвы всегда находится в центре внимания потенциальных клиентов любой организации. Аренда офиса ЦАО столицы – это возможность быстро попасть в любое место города, что является еще одним важнейшим фактором для просмотра имеющихся предложений арендатором.'),
(581432, 77, 164798, 6, 'Офис', 'Интересует аренда офиса ЮАО? Прекрасный офис – отражение успешности в бизнесе. Познакомьтесь с объявлениями на нашем сайте,  вам наверняка удастся найти подходящий вариант. Лучшие предложения: удобное месторасположение, приятные цены – аренда офиса ЮАО в самые короткие сроки и на лучших условиях для Москвы позволит успешно развиваться вашей компании. '),
(581433, 77, 164774, 6, 'Офис', 'Требуется помещение для работы компании? Интересует аренда офиса ЮВАО, как наиболее удобное место деятельности фирмы? На нашем сайте множество отличных предложений для арендаторов – долгосрочная аренда помещений от собственников залог процветания вашего бизнеса. Аренда офиса в ЮВАО – разные цены, метраж, количество комнат и планировка. Выбирайте лучшее. '),
(581434, 77, 164787, 6, 'Офис', 'Если вам срочно необходима аренда офиса ЮЗАО, то на нашем сайте вы сможете найти всю необходимую информацию, а так же просмотреть каталог возможных вариантов. Никогда аренда офиса ЮЗАО не была такой доступной и простой. Мы стараемся делать все для того, чтобы вам было удобно с нами сотрудничать. Вся информация в нашей базе данных постоянно обновляется.'),
(581435, 77, 164742, 6, 'Склад', 'К началу текущего года в Москве количество пустующих складов увеличилось на сотни тысяч кв. м. Предложений по найму появилось много и аренда склада САО также стала более доступной. Более того, ввиду заметного спроса среди потенциальных клиентов, аренда склада САО стала дешевле по сравнению с предыдущим годом. Количество пустующих помещений увеличилось, а спрос упал.'),
(581483, 77, 164831, 1, NULL, 'Северо-Восточный административный округ находится на севере Москвы. Стоит обратить внимание на районы округа, если вы нуждаетесь в улучшении жилищных условий и хотите купить квартиру. СВАО состоит из 17 районов, каждый из которых предлагает к продаже квартиры. СВАО предлагает широкий выбор недвижимости, как в новостройках, так и на вторичном рынке. В среде риэлторов прочно укоренилось мнение о том, что этот район является одним из наиболее недооцененных. Об этом должен знать каждый, кто желает купить квартиру. СВАО славится интересными жилищными проектами эконом- и бизнес-класса. Вторичный рынок недвижимости округа оживает после кризиса, благодаря чему легко можно осуществить как покупку, так и продажу квартиры. СВАО ждет своих покупателей.'),
(581489, 77, 164817, 1, NULL, 'В случае, если вам  срочно нужно купить квартиру ЗАО в Москве, вы можете смело обращаться к нам. Продажа квартиры ЗАО является одним из ведущих направлений нашей работы. В нашей базе представлено более 1000 видов самого разного жилья по лояльным ценам. Купить квартиру ЗАО с нами действительно очень просто. Вы сможете ознакомиться с нашими предложениями прямо на сайте. Подробнее узнать про планировку и месторасположения жилья, о ремонте в помещении и т.п. Продажа квартиры ЗАО осуществляется постоянно, не зависимо от праздничных и выходных дней. Мы стараемся сделать все возможное для того, чтобы нашим клиентом было выгодно и удобно с нами сотрудничать. По всем интересующим вопросам вы можете уже сегодня звонить нашим высококвалифицированным менеджерам.'),
(581490, 77, 164763, 1, NULL, 'Измайлово – это один из самых зеленых и чистых районов Москвы, в котором располагаются как красивые дома старой постройки, так и стильные новостройки. Измайлово является одним из наиболее удобных для проживания московских районов. Поэтому если вы решили купить квартиру в Измайлово – это, без сомнения, удачный выбор. Кроме того, покупка и последующая продажа квартиры в Измайлово может принести вам ощутимую выгоду в будущем. Это связано с тем, что аналитики в ближайшие 2-3 года прогнозируют серьезное повышение снизившихся в результате кризиса  цен на недвижимость в этом районе. Поэтому если вы планируете купить квартиру в Измайлово – лучше сделать это в ближайшее время. Осуществить такую процедуру, как покупка или продажа квартиры в Измайлово, вы легко сможете с помощью нашего сайта.'),
(581504, 77, 164862, 1, NULL, 'На нашем сайте вы сможете легко подобрать и затем купить квартиру ЦАО по самой доступной стоимостью. Мы сможем предложить вам массу вариантов жилья именно в этом районе. С нами купить квартиру ЦАО стало намного проще и доступнее. Для того, чтобы подробнее узнать обо всех вариантах, вы можете связаться с нашими менеджерами и ознакомиться с жильем, представленным на нашем веб сайте. Ваше новоселье наступит очень скоро!'),
(581505, 77, 164798, 1, NULL, 'ЮАО (Южный административный округ) – это один из самых динамично развивающихся районов Москвы, в котором на сегодняшний день располагается как комфортабельное жилье эконом-класса, так и элитное жилье. Сегодня купить квартиру в ЮАО – очень выгодно и престижно. Цены на недвижимость в этом районе постоянно растут, поэтому в будущем продажа квартиры в ЮАО сможет принести вам существенную прибыль. Кроме того, если вы решили купить квартиру в ЮАО – это будет не только удачным вложением денег, но и отличным способом подчеркнуть ваш высокий социальный статус, поскольку недвижимость в этом районе Москвы ценится очень высоко. Если вас интересует покупка или продажа квартиры в ЮАО, то вы легко сможете найти интересное для себя предложение, воспользовавшись нашим сайтом поиска недвижимости.'),
(581508, 77, 164810, 1, NULL, 'Итак, Вы решили купить квартиру. Южное Бутово предлагает квартиры различной площади и планировки. Продажа квартиры Южное Бутово осуществляется либо через агентства недвижимости, либо непосредственно у собственника. С помощью нашего сайта можно выбрать именно ту квартиру, которая будет удовлетворять по стоимости, количеству комнат, планировке и расположению дома. В этом районе Москвы чистый воздух, много детских садов, школ и игровых площадок. Поэтому, молодым семьям здесь будет очень выгодно купить квартиру. Южное Бутово – один из самых перспективных, динамично развивающихся районов столицы с экологически благоприятными условиями проживания. Продажа квартиры Южное Бутово может быть как в новостройках, так и в домах со стажем.'),
(581509, 77, 164787, 1, NULL, 'ЮЗАО (Юго-западный административный округ) – это один из самых  популярных районов Москвы. Многие хотят купить квартиру в ЮЗАО, поскольку это идеальный спальный район: в нем отсутствуют промышленные предприятия, воздух - чистый, хорошо развита инфраструктура. Если же вы не хотите жить в этом районе, то вы можете купить квартиру в ЮЗАО для получения денежной прибыли. Цены на недвижимость в этом районе постоянно растут, поэтому в будущем продажа квартиры в ЮЗАО может стать очень выгодной для вас. Чтобы покупка или продажа квартиры в ЮЗАО не стала для вас настоящей головной болью – воспользуйтесь услугами нашего сайта, на котором собраны предложения как продавцов, так и покупателей недвижимости в различных районах Москвы.'),
(581510, 77, 164841, 3, NULL, 'Если вы желаете купить квартиру Ярославский, то обратитесь на наш сайт, где расположены тысячи объявлений о продаже недвижимости, как в Москве, так и в других регионах России. Ведь чем больше предложений, тем выше шансы сделать правильный выбор и купить квартиру Ярославская, которая вас устроит как по цене, так и по всем прочим важным показателям.'),
(581516, 77, 164791, 1, NULL, 'Те, кого интересует продажа квартиры, Ломоновский район выбирают на основе низкой стоимости предлагаемого здесь жилья. В районе ходит транспорт, действуют медицинские и учебные учреждения. Однако приобретающим недвижимость следует учитывать, что продажа квартиры Ломоносовский – это слова, которые характеризуют большей частью здания, построенные еще в конце 50-х.'),
(581517, 77, 164824, 1, NULL, 'На данной странице вашему вниманию предлагается продажа квартиры Можайский район от конкретных собственников жилья. В каждом объявлении указывается точный адрес, метраж, особенности помещений и стоимость. Кроме того, если вы собственник, то можете подать свое объявление в рубрику продажа квартиры Можайский, подробно описав имеющуюся жилплощадь.'),
(581518, 77, 164792, 1, NULL, 'Черемушки по праву считаются замечательным районом, расположенном в юго-западной части Москвы недалеко от центра. Если проводится купля или продажа квартиры Черемушки очень высоко ценятся среди покупателей. Этот район Москвы, действительно, по праву называют элитным. Для того чтобы быстро и выгодно осуществилась продажа квартиры Черемушки располагают всеми преимуществами.'),
(581523, 77, 164810, 2, NULL, ' Желающих <b>сдать квартиру Южное Бутово</b> довольно много: предложений найма жилой недвижимости в данном районе достаточно. Этот благоустроенный пригород столицы, окруженный лесными массивами, с благоприятной экологией и хорошей инфраструктурой. Он сегодня интенсивно развивается. Поэтому существует возможность <b>сдать квартиру Южное Бутово</b> по хорошей цене.'),
(581539, 77, 164831, 6, 'Офис', ' Если вас интересует аренда офиса CВАО, вы попали на нужную страницу. Здесь вы найдете множество вариантов предложений собственников объектов – от небольших офисов до просторных офисных помещений для больших компаний. На сегодняшний день, аренда офиса CВАО – это выгодно и престижно. Кроме того, удобное расположение офисов – несомненный плюс для любого бизнеса.'),
(581545, 77, 164757, 6, 'Офис', 'Вас интересует аренда офисов в ВАО? На нашем сайте вы найдете множество предложений по аренде коммерческой недвижимости в Москве. Вашему вниманию представлены мелкие, средние и крупные бизнес-центры всех классов, а также складские и другие помещения. Вы сможете быстро сравнить цены, другие условия, оснащенность зданий и аренда офиса в ВАО займет у вас минимум времени! '),
(581548, 77, 164817, 6, 'Офис', ' Для серьезных деловых людей на нашем сайте всегда имеются в наличии такие предложения, как аренда офиса ЗАО. Западный административный округ является одним из самых престижных, живописных и экологически чистых районов Москвы с хорошо развитым транспортным сообщением. Безусловно, аренда офиса ЗАО – хороший деловой выбор для любого предпринимателя.'),
(581560, 77, 164742, 6, 'Офис', 'Аренда офиса САО будет особенно интересна тем компаниям, которые часто принимают делегации, гостей из других городов, из-за границы, поскольку аэропорт Шереметьево находится непосредственно на территории САО. Аренда офиса САО – это возможность получить отличный офис по сходной цене в районе с развитой инфраструктурой, и в непосредственной близости от центра. '),
(581562, 77, 164848, 6, 'Офис', ' Аренда офиса СЗАО не будет для вас проблемой, если вы обратитесь к нам. На нашем сайте вы найдете всю необходимую информацию, касающуюся аренды коммерческой недвижимости и жилых помещений в Москве. База данных на нашем веб ресурсе постоянно обновляется, так что аренда офиса СЗАО будет очень оперативной. Более подробную информацию можете узнать у наших менеджеров.'),
(581567, 77, 164862, 6, 'Офис', 'Безусловно, аренда офиса ЦАО Москвы – мечта многих арендаторов. Центральный административный округ Москвы всегда находится в центре внимания потенциальных клиентов любой организации. Аренда офиса ЦАО столицы – это возможность быстро попасть в любое место города, что является еще одним важнейшим фактором для просмотра имеющихся предложений арендатором.'),
(581568, 77, 164798, 6, 'Офис', 'Интересует аренда офиса ЮАО? Прекрасный офис – отражение успешности в бизнесе. Познакомьтесь с объявлениями на нашем сайте,  вам наверняка удастся найти подходящий вариант. Лучшие предложения: удобное месторасположение, приятные цены – аренда офиса ЮАО в самые короткие сроки и на лучших условиях для Москвы позволит успешно развиваться вашей компании. '),
(581569, 77, 164774, 6, 'Офис', 'Требуется помещение для работы компании? Интересует аренда офиса ЮВАО, как наиболее удобное место деятельности фирмы? На нашем сайте множество отличных предложений для арендаторов – долгосрочная аренда помещений от собственников залог процветания вашего бизнеса. Аренда офиса в ЮВАО – разные цены, метраж, количество комнат и планировка. Выбирайте лучшее. '),
(581570, 77, 164787, 6, 'Офис', 'Если вам срочно необходима аренда офиса ЮЗАО, то на нашем сайте вы сможете найти всю необходимую информацию, а так же просмотреть каталог возможных вариантов. Никогда аренда офиса ЮЗАО не была такой доступной и простой. Мы стараемся делать все для того, чтобы вам было удобно с нами сотрудничать. Вся информация в нашей базе данных постоянно обновляется.'),
(581571, 77, 164742, 6, 'Склад', 'К началу текущего года в Москве количество пустующих складов увеличилось на сотни тысяч кв. м. Предложений по найму появилось много и аренда склада САО также стала более доступной. Более того, ввиду заметного спроса среди потенциальных клиентов, аренда склада САО стала дешевле по сравнению с предыдущим годом. Количество пустующих помещений увеличилось, а спрос упал.'),
(581655, 77, 164831, 1, NULL, 'Северо-Восточный административный округ находится на севере Москвы. Стоит обратить внимание на районы округа, если вы нуждаетесь в улучшении жилищных условий и хотите купить квартиру. СВАО состоит из 17 районов, каждый из которых предлагает к продаже квартиры. СВАО предлагает широкий выбор недвижимости, как в новостройках, так и на вторичном рынке. В среде риэлторов прочно укоренилось мнение о том, что этот район является одним из наиболее недооцененных. Об этом должен знать каждый, кто желает купить квартиру. СВАО славится интересными жилищными проектами эконом- и бизнес-класса. Вторичный рынок недвижимости округа оживает после кризиса, благодаря чему легко можно осуществить как покупку, так и продажу квартиры. СВАО ждет своих покупателей.');
REPLACE INTO `seo_texts` (`id`, `region_id`, `region_node_id`, `section`, `real_estate_type`, `text`) VALUES
(581663, 77, 164757, 1, NULL, 'Купить квартиру ВАО не составляет никакой проблемы, а продажа квартиры ВАО пользуется огромным спросом.\nПри этом выбор недвижимости не ограничивается предложениями вторичного рынка жилья. Каждый год здесь возводятся новые микрорайоны. Общее количество запланированных новостроек ВАО составляет около полумиллиона квадратных метров.\nПлюс ко всему купить квартиру ВАО можно по весьма привлекательной цене. Так, квадратный метр в этом округе столицы стоит не более шести тысяч долларов. Продажа квартиры ВАО в панельных строениях, которые относятся к эконом-классу, осуществляется по цене в 4300 долларов за кв. метр.'),
(581671, 77, 164817, 1, NULL, 'В случае, если вам  срочно нужно купить квартиру ЗАО в Москве, вы можете смело обращаться к нам. Продажа квартиры ЗАО является одним из ведущих направлений нашей работы. В нашей базе представлено более 1000 видов самого разного жилья по лояльным ценам. Купить квартиру ЗАО с нами действительно очень просто. Вы сможете ознакомиться с нашими предложениями прямо на сайте. Подробнее узнать про планировку и месторасположения жилья, о ремонте в помещении и т.п. Продажа квартиры ЗАО осуществляется постоянно, не зависимо от праздничных и выходных дней. Мы стараемся сделать все возможное для того, чтобы нашим клиентом было выгодно и удобно с нами сотрудничать. По всем интересующим вопросам вы можете уже сегодня звонить нашим высококвалифицированным менеджерам.'),
(581672, 77, 164763, 1, NULL, 'Измайлово – это один из самых зеленых и чистых районов Москвы, в котором располагаются как красивые дома старой постройки, так и стильные новостройки. Измайлово является одним из наиболее удобных для проживания московских районов. Поэтому если вы решили купить квартиру в Измайлово – это, без сомнения, удачный выбор. Кроме того, покупка и последующая продажа квартиры в Измайлово может принести вам ощутимую выгоду в будущем. Это связано с тем, что аналитики в ближайшие 2-3 года прогнозируют серьезное повышение снизившихся в результате кризиса  цен на недвижимость в этом районе. Поэтому если вы планируете купить квартиру в Измайлово – лучше сделать это в ближайшее время. Осуществить такую процедуру, как покупка или продажа квартиры в Измайлово, вы легко сможете с помощью нашего сайта.'),
(581683, 77, 164834, 1, NULL, 'Марфино представляет собой современный район Москвы с достаточно развитой инфраструктурой. Если вы решили купить квартиру Марфино, то можете быть уверенны в правильности своего выбора. Множество торговых центров, супермаркетов, спортивных комплексов расположено в этом районе столицы. Здесь есть абсолютно всё для комфортного проживания людей всех возрастов. Продажа квартиры Марфино осуществляется  достаточно быстро, потому как желающих приобрести жилье в этом замечательном районе немало.\n\nВыбирая район Марфино, вы приобретаете квартиру вблизи от делового центра Москвы и в то же время в спокойном, тихом месте. Здесь расположены одни из самых красивых мест Москвы – Ботанический сад и парк Останкино.'),
(581688, 77, 164776, 1, NULL, 'Нижегородский район Москвы входит в один из двенадцати подразделений ЮВАО. Сегодня продажа квартиры Нижегородский район особой популярностью пользуется у приезжих. Купить квартиру Нижегородский район можно сравнительно недорого.\nИменно дешевизна и очевидная доступность не только этого места, но и ЮВАО в целом, объясняет высокий рост спроса, а значит и предложений купить квартиру Нижегородский район. \nМасштабное строительство бюджетных жилых комплексов началось совсем недавно. С 2006 года здесь одна за другой выросли новостройки. Сам район, некогда считавшийся не престижным, получил вторую жизнь. Продажа квартиры Нижегородский район Москвы – наиболее востребованное и выгодное предложение риэлторов.'),
(581691, 77, 164772, 1, NULL, 'Благодаря планам мэрии Москвы, продажа квартиры Новокосино выглядит весьма заманчивым предложением на рынке столичной недвижимости. Судите сами, современные паркинги, строящаяся станция метрополитена, комфортабельные новостройки…\nКстати, купить квартиру Новокосино сегодня все еще не столь дорого, нежели в других районах. Инфраструктура этого подразделения ВАО переживает настоящий бум. Ведь вместе с парковками и новыми транспортными узлами проект Новокосино включает также строительство торговых центров.\nПродажа квартиры Новокосино пользуется огромным спросом. Доказательством служит то, что в этом районе проживает более миллиона москвичей. Решение купить квартиру Новокосино – отличные инвестиции.'),
(581703, 77, 164780, 1, NULL, 'Уже сегодня мы поможем вам купить квартиру Рязанский проспект. Вы по достоинству оцените удобство работы с нашим веб сайтом, достоверность информации на нем, удобство навигации и т.п. Продажа квартиры Рязанский проспект нами осуществляется постоянно. Зайдите на веб ресурс и ознакомьтесь с нашей обширной и постоянно обновляемой базой жилья в Москве. Вы удивитесь, как может быть просто выбрать и купить квартиру Рязанский проспект в течение короткого срока. Продажа квартиры Рязанский р-он осуществляется в любое удобное для вас время, поэтому сотрудничество с нами будет не только выгодным, но и очень комфортным.\nОсобенно вам понравится карта Москвы, где вы сможете наглядно увидеть месторасположение вашего будущего жилья.'),
(581704, 77, 164742, 1, NULL, 'Северная часть Москвы очень привлекательна для всех, кто желает совершить сделку в сфере столичной недвижимостью. Для того, кто желает купить квартиру САО г. Москвы открывает широкие перспективы. Это обусловлено тем, что каждая продажа квартиры САО происходит в условиях реальной рыночной конкуренции. Продавцы и покупатели находят здесь возможность для взаимовыгодного сотрудничества.\n\nЕсли клиента интересует продажа квартиры САО, то он без труда сможет подобрать тот или иной объект на свой вкус. Количество предложений на рынке достаточно велико, поэтому любой желающий купить квартиру САО имеет возможность подобрать для себя эксклюзивный вариант, который будет отвечать всем необходимым критериям и пожеланиям.'),
(581706, 77, 164809, 1, NULL, 'Привлекательность района Северное Бутово обусловлена низкой стоимостью жилья. Ведь, купить квартиру Северное Бутово, расположенную за МКАД, можно намного дешевле, чем в других округах столицы.\nНе стоит забывать, что на его территории расположен огромный парк, в котором выращивают редчайшие растения. Купить квартиру Северное Бутово можно в пределах 120 000 руб. за кв/м.'),
(581719, 77, 164862, 1, NULL, 'На нашем сайте вы сможете легко подобрать и затем купить квартиру ЦАО по самой доступной стоимостью. Мы сможем предложить вам массу вариантов жилья именно в этом районе. С нами купить квартиру ЦАО стало намного проще и доступнее. Для того, чтобы подробнее узнать обо всех вариантах, вы можете связаться с нашими менеджерами и ознакомиться с жильем, представленным на нашем веб сайте. Ваше новоселье наступит очень скоро!'),
(581721, 77, 164798, 1, NULL, 'ЮАО (Южный административный округ) – это один из самых динамично развивающихся районов Москвы, в котором на сегодняшний день располагается как комфортабельное жилье эконом-класса, так и элитное жилье. Сегодня купить квартиру в ЮАО – очень выгодно и престижно. Цены на недвижимость в этом районе постоянно растут, поэтому в будущем продажа квартиры в ЮАО сможет принести вам существенную прибыль. Кроме того, если вы решили купить квартиру в ЮАО – это будет не только удачным вложением денег, но и отличным способом подчеркнуть ваш высокий социальный статус, поскольку недвижимость в этом районе Москвы ценится очень высоко. Если вас интересует покупка или продажа квартиры в ЮАО, то вы легко сможете найти интересное для себя предложение, воспользовавшись нашим сайтом поиска недвижимости.'),
(581724, 77, 164810, 1, NULL, 'Итак, Вы решили купить квартиру. Южное Бутово предлагает квартиры различной площади и планировки. Продажа квартиры Южное Бутово осуществляется либо через агентства недвижимости, либо непосредственно у собственника. С помощью нашего сайта можно выбрать именно ту квартиру, которая будет удовлетворять по стоимости, количеству комнат, планировке и расположению дома. В этом районе Москвы чистый воздух, много детских садов, школ и игровых площадок. Поэтому, молодым семьям здесь будет очень выгодно купить квартиру. Южное Бутово – один из самых перспективных, динамично развивающихся районов столицы с экологически благоприятными условиями проживания. Продажа квартиры Южное Бутово может быть как в новостройках, так и в домах со стажем.'),
(581725, 77, 164787, 1, NULL, 'ЮЗАО (Юго-западный административный округ) – это один из самых молодых и в то же время самых популярных и густонаселенных районов Москвы. Многие хотят купить квартиру в ЮЗАО, поскольку это идеальный спальный район: в нем отсутствуют промышленные предприятия, воздух - чистый, хорошо развита инфраструктура. Если же вы не хотите жить в этом районе, то вы можете купить квартиру в ЮЗАО для получения денежной прибыли. Цены на недвижимость в этом районе постоянно растут, поэтому в будущем продажа квартиры в ЮЗАО может стать очень выгодной для вас. Чтобы покупка или продажа квартиры в ЮЗАО не стала для вас настоящей головной болью – воспользуйтесь услугами нашего сайта, на котором собраны предложения как продавцов, так и покупателей недвижимости в различных районах Москвы.'),
(581726, 77, 164841, 3, NULL, 'Если вы желаете купить квартиру Ярославский, то обратитесь на наш сайт, где расположены тысячи объявлений о продаже недвижимости, как в Москве, так и в других регионах России. Ведь чем больше предложений, тем выше шансы сделать правильный выбор и купить квартиру Ярославская, которая вас устроит как по цене, так и по всем прочим важным показателям.'),
(581733, 77, 164791, 1, NULL, 'Те, кого интересует продажа квартиры, Ломоновский район выбирают на основе низкой стоимости предлагаемого здесь жилья. В районе ходит транспорт, действуют медицинские и учебные учреждения. Однако приобретающим недвижимость следует учитывать, что продажа квартиры Ломоносовский – это слова, которые характеризуют большей частью здания, построенные еще в конце 50-х.'),
(581734, 77, 164824, 1, NULL, 'На данной странице вашему вниманию предлагается продажа квартиры Можайский район от конкретных собственников жилья. В каждом объявлении указывается точный адрес, метраж, особенности помещений и стоимость. Кроме того, если вы собственник, то можете подать свое объявление в рубрику продажа квартиры Можайский, подробно описав имеющуюся жилплощадь.'),
(581735, 77, 164792, 1, NULL, 'Черемушки по праву считаются замечательным районом, расположенном в юго-западной части Москвы недалеко от центра. Если проводится купля или продажа квартиры Черемушки очень высоко ценятся среди покупателей. Этот район Москвы, действительно, по праву называют элитным. Для того чтобы быстро и выгодно осуществилась продажа квартиры Черемушки располагают всеми преимуществами.'),
(581744, 77, 164810, 2, NULL, ' Желающих <b>сдать квартиру Южное Бутово</b> довольно много: предложений найма жилой недвижимости в данном районе достаточно. Этот благоустроенный пригород столицы, окруженный лесными массивами, с благоприятной экологией и хорошей инфраструктурой. Он сегодня интенсивно развивается. Поэтому существует возможность <b>сдать квартиру Южное Бутово</b> по хорошей цене.'),
(582741, 77, 163164, 1, NULL, 'Эконом класс - предлагается квартира/комната Авиамоторная, спец предложения от собственников. Проверенные объявления предложение квартира/комната  м. Авиамоторная в базе недвижимости. Где найти недорогие  предложения  на вторичном рынке жилья -  продам квартиру/комнату Авиамоторная ?'),
(582742, 77, 163164, 2, NULL, 'Предлагаем «сдать квартиру/комнату Авиамоторная»  - срочное решение проблемы с поиском объектов недвижимости в Москве. Большой выбор недвижимости - объявления от хозяев на место.ру Элитные предложения  квартира/комната Авиамоторная арендую на сайте mesto.ru'),
(582743, 77, 163164, 3, NULL, 'На сайте вы можете найти предложения о продаже дома Авиамоторная в Москве без посредников недорого. Недвижимость в Москве у м. Авиамоторная на сайте объявлений по продам дом. Бюджетные предложения на дом Авиамоторная  - фото, цены, контакты собственников в разделе продам дом Авиамоторная  '),
(582744, 77, 163164, 4, NULL, 'Объявления  от собственников и агентств недвижимости в разделе аренда дом Авиамоторная  вторичный по низким ценам. Большой выбор недвижимости - объявления от хозяев на место.ру Бюджетные предложения на дом Авиамоторная  - фото, цены, контакты собственников в разделе возьму внаем дом Авиамоторная  '),
(582745, 77, 163164, 5, NULL, 'Решение для тех, кто заинтересовался вопросом «Как  найти  коммерческую недвижимость у м. Авиамоторная», предлагаем самую актуальную базу предложений в Москве. База недвижимости в Москве по запросу  "купить коммерческую недвижимость  м. Авиамоторная". Цены на жилье в Москве, купля-продажа коммерческой недвижимости станция Авиамоторная от  бизнес-класса до недорого на вторичном рынке.'),
(582746, 77, 163164, 6, NULL, 'Сдать в аренду коммерческую недвижимость м Авиамоторная от собственника. Поиск объявлений "сдаю внаем коммерческую недвижимость, возле м. Авиамоторная в Москве. Цены на аренду офисов в Москве, коммерческая недвижимость в аренду станция Авиамоторная:бизнес-класс, недорого с фото.'),
(582747, 77, 163165, 1, NULL, 'Вторичный рынок -  продажа квартира/комната Автозаводская, полная информация с ценами для тех, кто ищет дешево и без посредников. Поиск объявлений предлагается квартира/комната, расположенных возле м. Автозаводская в Москве. Знаете  сколько стоит  продажа квартира/комната Автозаводская? на сайте доступны фото, цены, телефоны собственников. '),
(582748, 77, 163165, 2, NULL, 'Аренда квартир/комната Автозаводская – все предложения в Москве. Все объявления о недвижимости в Москве и области на сайте mesto.ru  Как найти дешевые предложения без посредников  - сдаю квартира/комната Автозаводская?'),
(582749, 77, 163165, 3, NULL, 'Последние добавленные предложения  по запросу  купить дом Автозаводская с контактами собственников, помощь тем, кто хочет дом  покупаю в Москве. купить дом Автозаводская. Найти желающих купить дом Автозаводская на портале, вторичный рынок -  дешево и без посредников. '),
(582750, 77, 163165, 4, NULL, 'Последние добавленные предложения  по запросу  сдам внаем дом Автозаводская с контактами собственников, помощь тем, кто хочет дом  сдам внаем в Москве. Автозаводская  - база  объявлений от частных лиц и организаций: сдаю дом  Все объявления по запросу сдать в аренду дом станция Автозаводская, цены от элитных предложений до недорогих.'),
(582751, 77, 163165, 5, NULL, 'Бесплатные предложения в разделе покупаю коммерческую недвижимость Автозаводская – в отличном состоянии, быстро и надежно. Продать коммерческую недвижимость Автозаводская. Элитные предложения  коммерческая недвижимость Автозаводская покупка на сайте mesto.ru'),
(582752, 77, 163165, 6, NULL, 'Эконом класс - снять коммерческую недвижимость Автозаводская, спец предложения от собственников. сниму коммерческую недвижимость Автозаводская. Дешевые предложения на вторичном рынке от хозяев -  сниму коммерческую недвижимость Автозаводская.'),
(582753, 77, 163166, 1, NULL, 'Есть ли дешево квартира/комната  у Академическая? Узнайте как  предлагается квартира/комната в Москве Дешево квартира/комната Академическая в базе объявлений на Место.ру От собственников свежие объявления купить квартира/комната Академическая.'),
(582754, 77, 163166, 2, NULL, 'сдается квартира/комната Академическая с фото и стоимостью  в любой ценовой категории: бизнес-класс, элитка, вторичка . Выбрать объявления квартира/комната у станции метро Академическая для сдать внаем. Найти желающих снять квартира/комната Академическая на портале, вторичный рынок -  дешево и без посредников. '),
(582755, 77, 163166, 3, NULL, 'Академическая предложение дом без посредников, предложения с фото, вторичка, все виды недвижимости от элитной до недорогой. База недвижимости в Москве от хозяев и риэлторов. Дешево предлагаю дом Академическая, предложения от собственников и риэлторов  Москве.'),
(582756, 77, 163166, 4, NULL, 'Бесплатные предложения в разделе сдать в аренду дом Академическая – в отличном состоянии, быстро и надежно. Сайт с объявлениями от риэлторов и собственников Москвы. дом возьму в аренду Академическая на портале mesto.ru для тех, кто самостоятельно ищет недвижимость в Москве без посредников. '),
